import React from 'react';
import { LineChart, Line, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';
import { Card } from '@/components/ui/card';

const SPReturnsChart = ({ ReturnsData = [] }) => {
  // Ensure we have valid data
  const validData = Array.isArray(ReturnsData) ? ReturnsData : [];

  // Default data if none provided
  const defaultData = [
    { date: '2023-01', return: 0 },
    { date: '2023-02', return: 0 },
    { date: '2023-03', return: 0 }
  ];

  const chartData = validData.length > 0 ? validData : defaultData;

  // Calculate stats safely
  const latestReturn = chartData[chartData.length - 1]?.return || 0;
  const peakReturn = Math.max(...chartData.map(item => item?.return || 0));
  const averageReturn = chartData.length > 0
    ? (chartData.reduce((acc, curr) => acc + (curr?.return || 0), 0) / chartData.length)
    : 0;

  // Custom tooltip
  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      return (
        <div className="bg-white p-3 shadow-lg rounded-lg border border-gray-100">
          <p className="font-medium text-gray-600">{label}</p>
          <p className="text-sm text-emerald-600">
            Return: {payload[0].value.toFixed(2)}%
          </p>
        </div>
      );
    }
    return null;
  };

  return (
    <Card className="w-full max-w-4xl p-6">
      {/* Header Section */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold text-gray-800">S&P 500 Total Returns</h2>
        <p className="text-sm text-gray-500">Historical performance tracking</p>
      </div>

      {/* Chart Section */}
      <div className="h-64 w-full">
        <ResponsiveContainer width="100%" height="100%">
          <LineChart
            data={chartData}
            margin={{ top: 5, right: 10, left: 10, bottom: 5 }}
          >
            <defs>
              <linearGradient id="returnGradient" x1="0" y1="0" x2="0" y2="1">
                <stop offset="5%" stopColor="#10b981" stopOpacity={0.1}/>
                <stop offset="95%" stopColor="#10b981" stopOpacity={0}/>
              </linearGradient>
            </defs>

            <XAxis
              dataKey="date"
              axisLine={false}
              tickLine={false}
              tick={{ fill: '#6b7280', fontSize: 12 }}
              dy={10}
            />
            <YAxis
              axisLine={false}
              tickLine={false}
              tick={{ fill: '#6b7280', fontSize: 12 }}
              dx={-10}
              tickFormatter={(value) => `${value}%`}
            />
            <Tooltip content={<CustomTooltip />} />

            <Line
              type="monotone"
              dataKey="return"
              stroke="#10b981"
              strokeWidth={2}
              dot={false}
              activeDot={{ r: 6, fill: '#10b981' }}
              fillOpacity={1}
              fill="url(#returnGradient)"
            />
          </LineChart>
        </ResponsiveContainer>
      </div>

      {/* Summary Stats */}
      <div className="grid grid-cols-3 gap-4 pt-4 mt-4 border-t">
        <div>
          <p className="text-sm text-gray-500">Latest Return</p>
          <p className="text-2xl font-semibold text-emerald-600">
            {latestReturn.toFixed(2)}%
          </p>
        </div>
        <div>
          <p className="text-sm text-gray-500">Peak Return</p>
          <p className="text-2xl font-semibold">
            {peakReturn.toFixed(2)}%
          </p>
        </div>
        <div>
          <p className="text-sm text-gray-500">Average Return</p>
          <p className="text-2xl font-semibold">
            {averageReturn.toFixed(2)}%
          </p>
        </div>
      </div>
    </Card>
  );
};

export default SPReturnsChart;
